int dzielnikiWlasciwe(int n) {
	auto wynik{ 1 };
	int i;
	for (i = 2; i * i < n; ++i) {
		if (n % i == 0) {
			wynik += i;
			wynik += (n / i);
		}
	}
	if (i * i == n) {
		wynik += i;
	}
	return wynik;
}

